import styled from 'styled-components';

export const StyledLabel = styled.label`
  font-size: 12px;
  font-style: normal;
  font-weight: normal;
  font-family: Noto Sans JP, sans-serif;
  color: #797979;
  line-height: 150%;
  letter-spacing: 0.06em;
`;

export const StyledTitle = styled.title`
  display: block;
  font-family: Noto Sans JP, sans-serif;
  font-style: normal;
  font-weight: bold;
  font-size: 16px;
  line-height: 150%;
  text-align: center;
  color: #333333;
  margin-top: 12px;
  margin-bottom: 12px;
  width: 100%;
`;

export const StyledText = styled.div`
  font-size: 12px;
  font-style: normal;
  font-weight: normal;
  font-family: Noto Sans JP, sans-serif;
  color: #333333;
  line-height: 150%;
  letter-spacing: 0.06em;
`;
